        },
        {
            id:2,
            imgSrc:'/images/Povestea SF foto site/11.jpg',
        },
        {
            id:3,
            imgSrc:'/images/Povestea SF foto site/118188958_3506456106054639_6530225995219771555_n.jpg',
        },
        {
            id:4,
            imgSrc:'/images/Povestea SF foto site/12.jpg',
